e=A.a([new A.b7("Hematopoietic Enrollment Form","Hematopoietic refers to the formation of blood cells. The hematopoietic system is responsible for producing all of the blood cells in the body, including red blood cells, white blood cells, and platelets.\nThe hematopoietic system is made up of several organs and tissues, including:\nBone marrow: The bone marrow is the main site of blood cell production. It is found in the cavities of bones, such as the ribs, spine, and pelvis.\nSpleen: The spleen is a small organ located in the upper left abdomen. It filters the blood and removes old or damaged blood cells.\nThymus: The thymus is a small organ located in the chest. It is responsible for the development of T cells, a type of white blood cell.\nLymph nodes: Lymph nodes are small, bean-shaped organs that are found throughout the body. They filter the lymph fluid and remove bacteria and other foreign substances.",a0,"")],r)
